  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kanuti
  NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, and compliance with environmental and
  cultural resource mandates. Refuge administration is outlined; information about
  personnel, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, forests, fire management, and wilderness areas. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  and animal control. The public uses of the Refuge described in this report include
  interpretive programs, hunting, fishing, trapping, wildlife observation, and outdoor
  recreation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
